import React, { Component } from 'react';
import axios from 'axios';
import './ParkingDetails.scss';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from 'react-responsive-carousel';

 class ParkingDetails extends Component {

    state = {
        parkingDetail : []
    }


    componentDidMount () {

                if(this.props.match.params.id){
                    if(!this.state.parkingDetail || (this.state.parkingDetail && this.state.parkingDetail.id !== this.props.match.params.id))
                    axios.get('/property/' + this.props.match.params.id)
                        .then( response => {
                        console.log(response.data);
                        this.setState({parkingDetail : response.data});

                    });
                }
        }


    render(props) {



        let parking = <p style={{textAlign:"center"}}>Please select A Parking</p>

        const parkingDetail = this.state.parkingDetail

        if(this.state.parkingDetail){

            parking = (
                <div className="DetailParking">
                    <div className="DetailParking__wrapper">
                        <div className="title">

                         <p className="parking__name">{parkingDetail.name}</p>



                        <Carousel className="carousel__box">
                                <div className="carousel__images" >
                                    <img  src={parkingDetail.image} alt="img" />
                                    <p className="legend">Img 1</p>
                                </div>
                                <div>
                                    <img  src={parkingDetail.image} alt="img" />
                                    <p className="legend">Img 2</p>
                                </div>
                                <div>
                                    <img  src={parkingDetail.image} alt="img" />
                                    <p className="legend">Img 3</p>
                                </div>
                        </Carousel>


                            <h3>{parkingDetail.location}</h3>
                            <h3>{parkingDetail.type}</h3>
                        </div>
                    </div>
                </div>
            );
        }
        return parking
    }
}
export default ParkingDetails;
